function initializeValidations() {
  $('#new-event-form').validate({
    rules: {
      'event[name]': { required: true },
      'event[start_time]': { required: true },
      'event[address]': { required: true },
      'event[city]': { required: true },
      'event[country]': { required: true },
      'event[description]': { required: true },
      'event[image]': {extension: "jpg|jpeg|png|gif"},
      'user[name]': {required: true},
      'user[surname]': {required: true},
      'user[email]': {
            required: true,
            email: true,
            remote: "/check_email" },
      'user[password]': {required: true},
      'user[password_confirmation]': {equalTo : "#user_password"}
    },
    messages: {
      'event[name]': I18n[window.gon.locale]['name'],
      'event[start_time]': I18n[window.gon.locale]['start_time'],
      'event[address]': I18n[window.gon.locale]['address'],
      'event[city]': I18n[window.gon.locale]['city'],
      'event[country]': I18n[window.gon.locale]['country'],
      'event[description]': I18n[window.gon.locale]['description'],
      'event[image]': I18n[window.gon.locale]['image_extension'],
      'user[name]': I18n[window.gon.locale]['first_name'],
      'user[surname]': I18n[window.gon.locale]['surname'],
      'user[email]': {
            required: I18n[window.gon.locale]['email'],
            email: I18n[window.gon.locale]['valid_email'],
            remote: I18n[window.gon.locale]['existing_email']},
      'user[password]': I18n[window.gon.locale]['password'],
      'user[password_confirmation]': I18n[window.gon.locale]['current_pass'],
    },
    errorElement: "div",
    errorClass: "text-danger",
    errorId: "event_error",
    errorPlacement: function (error, element) {
      error.insertAfter(element);
      element.closest('div').addClass('has-error');
    },
    success: function (label) {
      label.closest('.form-event').removeClass('has-error').addClass('has-success');
    }
  });
};

function initializeEditEventValidations() {
    $('#edit-event-form').validate({
      rules: {
        'event[name]': { required: true },
        'event[city]': { required: true },
        'event[country]': { required: true },
        'event[description]': { required: true },
        'event[flyer]': {extension: "jpg|jpeg|png|gif"},
        'event[image]': {extension: "jpg|jpeg|png|gif"}
      },
      messages: {
        'event[name]': I18n[window.gon.locale]['name'],
        'event[city]': I18n[window.gon.locale]['city'],
        'event[country]': I18n[window.gon.locale]['country'],
        'event[description]': I18n[window.gon.locale]['description'],
        'event[flyer]': I18n[window.gon.locale]['image_extension'],
        'event[image]': I18n[window.gon.locale]['image_extension']
      },
      errorElement: "div",
      errorClass: "text-danger",
      errorId: "event_error",
      errorPlacement: function (error, element) {
        error.insertAfter(element);
        element.closest('div').addClass('has-error');
      },
      success: function (label) {
          label.closest('.form-group').removeClass('has-error').addClass('has-success');
          label.next('.help-block').hide();
      }
    });
  };

function fundraiserCheck() {
   if($("#event_event_type").prop("selectedIndex") === 3){
        $('#fundraise_div').removeClass('hidden');
        $('#create_event').prop('disabled', true);
        $('#fundraise_approval').click(function() {
            if ($('#fundraise_approval').prop('checked') == true) {
                $('#create_event').prop("disabled", false);
            }
            else {
                $('#create_event').prop('disabled', true);
            }
        });
    }
    else {
        $('#fundraise_div').addClass('hidden');
        $('#create_event').prop("disabled", false);
    }
}

function formValid(nextButton, fieldset){
    return $('#new-event-form').valid();
}

function goToNextStep(button) {
  current_fieldset = $(button).closest('fieldset');

  if(!formValid(button, current_fieldset))
    return false;

  next_fieldset = current_fieldset.next().show();
  current_fieldset.hide();
  };

function goToPreviousStep(button) {
  current_fieldset = $(button).closest('fieldset');
  previous_fieldset = current_fieldset.prev('fieldset');
  current_fieldset.hide();
  previous_fieldset.show();
}

function new_events_page() {
  return location.pathname.match(/new/) != null;
};

function my_events_page() {
  return location.pathname.match(/my_events/) != null;
};

$(document).ready(function() {



  if(new_events_page()){
    initializeValidations();
    fundraiserCheck();
  }

  if(my_events_page()){
    initializeEditEventValidations();
  }

  $(".next").click(function() {
    goToNextStep(this);
  });

  $(".previous").click(function() {
    goToPreviousStep(this);
  });

  $("#event_time_tbd").bind('change', function(){
    if(this.checked){
      $("#event_start_time").val("");
      $("#event_end_time").val("");
      $("#event_start_time").prop('disabled', true);
      $("#event_end_time").prop('disabled', true);
    }
    else{
      $("#event_start_time").prop('disabled', false);
      $("#event_end_time").prop('disabled', false);
    }
  })

  $("#event_location_tbd").bind('change', function(){
    if(this.checked){
      $("#event_address").val("")
      $("#event_address2").val("")
      $("#event_zip").val("")
      $("#event_address").prop('disabled', true);
      $("#event_address2").prop('disabled', true);
      $("#event_zip").prop('disabled', true);
    }
    else{
      $("#event_address").prop('disabled', false);
      $("#event_address2").prop('disabled', false);
      $("#event_zip").prop('disabled', false);
    }
  })

  $(function() {
      $('#search_input').fastLiveFilter('#search_events');
  });

  $('#search_input').fastLiveFilter('#search_events', {
  timeout: 200,
  callback: function(total) { $('#num_results').html(total); }
  });

$('#event_location_tbd').bind(function() {
    $('#yourInput').val( $(this).text() ).keyup();
    return false;
});


});
var ready;
var map;

ready = function () {

  function pan() {
    var coordinates = window.gon.coordinates
    if(coordinates != undefined) {
      var panPoint = new google.maps.LatLng(coordinates[0], coordinates[1]);
      map.setZoom(6);
      map.panTo(panPoint);
    }
  }

  var events;
  var times;
  var event_images;
  var addresses;
  var location_details;
  var event_ids;
  var locale;
  var event_types = [];
  var location_array = [];
  var event_names = [];
  var event_path = [];
  var coordinates = window.gon.coordinates
  if(window.gon.events != undefined || window.gon.event_types != undefined) {
    events = window.gon.events;
    times = window.gon.times;
    event_images = window.gon.event_images;
    addresses = window.gon.addresses;
    location_details = window.gon.location_details
    event_ids = window.gon.event_ids;
    event_pks = window.gon.event_pks;
    locale = window.gon.locale;
    for (var i=0; i < events.length; i++) {
      location_array.push(new google.maps.LatLng(events[i].latitude, events[i].longitude));
      event_names.push(events[i].name);
      event_types.push(window.gon.event_types[events[i].event_type_id - 1].name);
      event_path.push('/events/'+ event_ids[i]);
    }

    function initialize() {
       var map_styles = [{"featureType":"landscape","stylers":[{"saturation":-100},{"lightness":65},{"visibility":"on"}]},{"featureType":"poi","stylers":[{"saturation":-100},{"lightness":51},{"visibility":"simplified"}]},{"featureType":"road.highway","stylers":[{"saturation":-100},{"visibility":"simplified"}]},{"featureType":"road.arterial","stylers":[{"saturation":-100},{"lightness":30},{"visibility":"on"}]},{"featureType":"road.local","stylers":[{"saturation":-100},{"lightness":40},{"visibility":"on"}]},{"featureType":"transit","stylers":[{"saturation":-100},{"visibility":"simplified"}]},{"featureType":"administrative.province","stylers":[{"visibility":"off"}]},{"featureType":"water","elementType":"labels","stylers":[{"visibility":"on"},{"lightness":-25},{"saturation":-100}]},{"featureType":"water","elementType":"geometry","stylers":[{"hue":"#ffff00"},{"lightness":-25},{"saturation":-97}]}]
       var mapOptions = {
        scrollwheel: false,
        center: new google.maps.LatLng(40, -23),
        zoom: 2,
        styles: map_styles
      };

      map = new google.maps.Map(document.getElementById("map-canvas"),
          mapOptions);

      var infowindow = new google.maps.InfoWindow();

      for (var i = 0; i < location_array.length; i++) {
        marker = new google.maps.Marker({
          map:map,
          draggable:false,
          animation: google.maps.Animation.DROP,
          position: location_array[i],
          title: event_names[i],
        });

        google.maps.event.addListener(marker, 'click', function(marker, i) {
          return function() {

        infowindow.setContent('<div class="contentWindow"><h4><a href =' + event_path[i]+'>' + event_names[i] + '</a>' +
        '&nbsp' + '&nbsp' + '&nbsp' + '&nbsp' +
        '<img src="' + event_images[i] + '" class="marker_image"></h4>' +
        '<div>' + event_types[i] + '</div>' + '<hr>' +
        '<h6>Where:</h6>' +
        '<div>' + location_details[i] + '</div>' +
        '<div>' + addresses[i] + '</div>' +
        '<h6>When:</h6>' +
        '<div>' + times[i] + '</div></br>' +
        '<div><a class ="btn contact-link btn-contact btn-modal" href="' + location.origin + "/" + locale + '/contact/' + event_ids[i] + '" rel="modal:open">CONTACT HOST</a>' +
        '<a class="btn floatRight btn-attend btn-modal" href="' +location.origin + "/" + locale + '/new_attendee_user?event=' + event_pks[i] +  '" rel="modal:open">ATTEND</a>' +
        '</div></div>');
            infowindow.open(map, marker);
          }
        }(marker, i));
      }

      pan();

    }
    google.maps.event.addDomListener(window, 'load', initialize);
  };

};

function addEvent(element, event, fn) {
    if (element.addEventListener)
        element.addEventListener(event, fn, false);
    else if (element.attachEvent)
        element.attachEvent('on' + event, fn);
}

addEvent(window, 'load', ready);
$(document).ready(ready);
$(document).on('page:load', ready);
